import React from 'react';

export default class Cell extends React.Component{
    render(){
        return(
            <button 
                style="height: 50px, width: 50px"
                className="cell" 
                onClick={() => this.props.onClick()}
            >
                {this.props.value}
            </button>
        );
    }
}
